export default class Channels extends React.Component {

    render() {
        return (
            <div>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ant1</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Alpha</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Mega</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Star</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Skai</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert1</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert2</button></Link>
                <Link href="/"><button type="button" className="btn btn-outline-info" onClick={this.props.onCLick}>Ert3</button></Link>
            </div>
        )
    }
}
